var certificateModule = (function(){

    return {
        generateCertificate: function(data){
          var imageData = 'data:image/png;base64,';
          // create document
          var doc = new jsPDF();
          // add image
          doc.addImage(imageData, "JPEG", 15, 40, 180, 140);
          // add title
          doc.setFont("times");
          doc.setFontType("italic");
          doc.setTextColor(29, 210, 242);
          doc.setFontSize(21);
          doc.text(105, 65, "TYPING SPEED CERTIFICATE", "center");
          // add text
          doc.setTextColor(96, 96, 96);
          doc.setFontSize(16);
          doc.text(105, 75, "This Certficiate is Hereby Awarderd to:", "center");
          // add name
          var button = event.target;
          var nameField = button.parentElement.previousElementSibling.children[1].children[1];
          var name = nameField.value;
          doc.setFont("times");
          doc.setFontType("italic");
          doc.setTextColor(29, 210, 242);
          doc.setFontSize(18);
          doc.text(105, 83, name, "center");
          // add text
          doc.setFont("times");
          doc.setFontType("italic");
          doc.setTextColor(96, 96, 96);
          doc.setFontSize(14);
          doc.text(105, 95, "For Achieving Results noted below as documented", "center");
          doc.text(105, 100, "and verified by Chunchunmaru Brand", "center");
          // add results
         var level = event.target.getAttribute('level');
          doc.setFontSize(15);
          doc.text(105, 115, "Level: " + level, "center");
          doc.text(105, 122, "Average Speed: " + data.wpm +  " wpm", "center");
          doc.text(105, 129, "Accuracy: " + data.accuracy +"%", "center");
          // add date
          var date = new Date();
          date = date.toLocaleDateString("en-US");
          doc.text(128, 139, "Awarded on: " + date);
          // add brand
          doc.text(130, 144, "Chunchunmaru Brand");
          doc.setFontSize(10);
          doc.text(105, 152, "It's just a prototype project.", "center");
          doc.text(105, 155, "Using it for official purpose or anything like that is strictly discouraged.", "center");
          doc.text(105, 158, "But make sure to have fun with it.", "center");
          doc.text(105, 161, "Arigatou gozaimasu!!!", "center");
          // save document
          doc.save("Certificate.pdf");
        }
    };
})();
